const bgImgInput = document.getElementById('bg-img-input');
const bgImgForm = document.getElementById('bg-img-form');

const image1 = new Image();
let newImageUrl = '';

function firstLoadImage(){
        let image_url = 'data:image/jpeg;base64,';

        let image = document.createElement("img");
        image.src = image_url;

        image.onload = function(event){
          let canvas = document.createElement("canvas");
          canvas.width = (screen.width+400)/1.9;
          canvas.height = (screen.height-((screen.height/100)*13));

          const ctx = canvas.getContext("2d");
          ctx.drawImage(image, 0, 0, canvas.width, canvas.height);

          newImageUrl = ctx.canvas.toDataURL("image/png");
          img = loadImage(`${newImageUrl}`);
        }
}

function getInputImage(){
  var file = bgImgInput.files[0];
    var reader = new FileReader();
    reader.readAsDataURL(file);

    reader.onload = function(e){
        let image_url = e.target.result;
        let image = document.createElement("img");
        image.src = image_url;

        image.onload = function(event){
          let canvas = document.createElement("canvas");
          canvas.width = (screen.width+400)/1.9;
          canvas.height = screen.height-((screen.height/100)*13);

          const ctx = canvas.getContext("2d");
          ctx.drawImage(image, 0, 0, canvas.width, canvas.height);

          newImageUrl = ctx.canvas.toDataURL("image/png");
          img = loadImage(`${newImageUrl}`);
        }
    }
}

bgImgForm.addEventListener('submit', (e) => {
    e.preventDefault();
    getInputImage();
});
window.onresize = function(){
    if(bgImgInput.files.length > 0){
      getInputImage();
    }else{
      firstLoadImage();
    }
}

let sourceText;
let poem;
let img;
let startIndex = 0;

function getRandom(min, max){
    return Math.random() * (max-min) + min;
}
function componentToHex(comp) {
    var hex = comp.toString(16);
    return hex.length == 1 ? "0" + hex : hex;
}
function rgbToHex(r, g, b) {
    return "#" + componentToHex(r) + componentToHex(g) + componentToHex(b);
}

function preload() {
  firstLoadImage();
  //img = loadImage(`${newImageUrl}`);
  sourceText = loadStrings("imgs/sourceText.txt");
}

function setup() {
  asciiDiv = document.getElementById('ascii-div');
  noCanvas();
  sourceText = sourceText.join(' ');
}


const density = "@#W$9876543210?!abc;:+=-,._ ";
function draw() {
  background(0);
  frameRate(10*20);
  
  let charIndex = startIndex;
  img.loadPixels();
  let asciiImage = "";
    for (let j = 0; j < img.height; j+=12) {
        for (let i = 0; i < img.width; i+=12) {
            const pixelIndex = (i + j * img.width) * 4;
            const r = img.pixels[pixelIndex + 0];
            const g = img.pixels[pixelIndex + 1];
            const b = img.pixels[pixelIndex + 2];
            
            const a = img.pixels[pixelIndex + 3];
            const avg = (r + g + b) / 3;
            const len = sourceText.length;
            const index = floor(map(avg, 0, 255, 0, len));
            
            /*
            noStroke();
            if(avg > 50){
                fill(r,g,b,a);  
            }else{
                fill(0,0,0,0);
            }
            textSize(w*1.2);
            textAlign(CENTER, CENTER);
            text(sourceText.charAt(charIndex%sourceText.length), i * w + w * 0.5, j * h + h * 0.5);
            */
            
            let c = density.charAt(index%sourceText.length);
            c += sourceText.charAt(charIndex%density.length);
            c = c.fontcolor(`${rgbToHex(r, g, b)}`);
            if(c == ' ') asciiImage += '&nbsp;';
            if(c == 'W' && getRandom(1, 10) > 9) asciiImage += 'X';
            if(c == 'S' && getRandom(1, 10) < 9) asciiImage += '$';
            else asciiImage += c;

            charIndex++;
        }
        asciiImage += '<br>';
    }
    asciiDiv.innerHTML = asciiImage;
  startIndex++;
}